import { Text,Box } from"native-base"
 const Post = ({item})=>{
     if(item.id){
          return (
               <Box>
               <HStack style={{justifyContent:'space-between',margin:5}}>
                   <VStack>
                       <Text>
                       <Text style={{fontWeight:'bold'}}>
                               
                               Title:
                               </Text>
                           mostafa
                       </Text>
                        
                     </VStack>
                     <ArrowForwardIcon onPress={()=>{
                         navigation.navigate({name:'postsdetails',params:{
                             id:item.id
                         }})
                     }}/>
                 </HStack>
             </Box>)
         
     }
        
     return <Text>No Post</Text>
}
export default Post;
